import React, { useEffect, useMemo, useState } from "react";
import axios from "axios";
import "./App.css";

const api = axios.create({
  baseURL: "http://localhost:8000",
});

function Output() {
  const [products, setProducts] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(function () {
    api.get("/products/")
      .then(function (res) {
        setProducts(res.data);
      })
      .finally(function () {
        setLoading(false);
      });
  }, []);

  const stats = useMemo(function () {
    const totalItems = products.length;
    const totalQuantity = products.reduce(function (sum, p) {
      return sum + p.quantity;
    }, 0);

    const totalValue = products.reduce(function (sum, p) {
      return sum + p.price * p.quantity;
    }, 0);

    const lowStock = products.filter(function (p) {
      return p.quantity <= 5;
    }).length;

    return {
      totalItems: totalItems,
      totalQuantity: totalQuantity,
      totalValue: totalValue,
      lowStock: lowStock,
    };
  }, [products]);

  if (loading) {
    return React.createElement(
      "div",
      { className: "loader" },
      "Loading Output..."
    );
  }

  return (
    <div className="app-bg">
      <header className="topbar">
        <div className="brand">
          <span className="brand-badge">ðŸ“¦</span>
          <div>
            <h1>RO Spares Track</h1>
            <small className="muted">Final Inventory Output</small>
          </div>
        </div>
      </header>

      <div className="container">
        <div className="kpi-grid">
          <div className="kpi-card">
            <span>Total Products</span>
            <strong>{stats.totalItems}</strong>
          </div>

          <div className="kpi-card">
            <span>Total Quantity</span>
            <strong>{stats.totalQuantity}</strong>
          </div>

          <div className="kpi-card">
            <span>Inventory Value</span>
            <strong>${stats.totalValue.toFixed(2)}</strong>
          </div>

          <div className="kpi-card danger">
            <span>Low Stock Items</span>
            <strong>{stats.lowStock}</strong>
          </div>
        </div>

        <div className="card list-card">
          <h2>Inventory Summary</h2>

          <div className="scroll-x">
            <table className="product-table">
              <thead>
                <tr>
                  <th>ID</th>
                  <th>Name</th>
                  <th>Description</th>
                  <th>Price</th>
                  <th>Quantity</th>
                  <th>Status</th>
                </tr>
              </thead>

              <tbody>
                {products.map(function (p) {
                  return (
                    <tr key={p.id}>
                      <td>{p.id}</td>
                      <td className="name-cell">{p.name}</td>
                      <td className="desc-cell">{p.description}</td>
                      <td className="price-cell">
                        ${Number(p.price).toFixed(2)}
                      </td>
                      <td>
                        <span className="qty-badge">{p.quantity}</span>
                      </td>
                      <td>
                        {p.quantity <= 5 ? (
                          <span className="status low">Low</span>
                        ) : (
                          <span className="status ok">Available</span>
                        )}
                      </td>
                    </tr>
                  );
                })}
              </tbody>
            </table>
          </div>
        </div>

        <footer className="output-footer">
          <span>âœ” Output generated successfully</span>
          <span className="muted">Powered by Raghav</span>
        </footer>
      </div>
    </div>
  );
}

export default Output;
